request: https://github.com/octokit/request.js#request
*/

import {BrowserRouter as Router, Route, Switch, Routes} from 'react-router-dom';

import Title from "./Title.js";
import Search from "./Search.js";
import Results from "./Results.js";
import { httpFlag, repo } from "./Results";

function App() {

	return (
		<Router>
			<div className="App">
				<Title />
				{/* <Search /> */}
        <Routes>
          <Route path="/" element={<Search />}></Route>
          <Route path="/users/:username/repos" element={
                  httpFlag === true ? (
                      // <Results repo={ repo } header={ username }/>
                      <Results repo={ repo } />

                  ) : (
                      <p>Unvalid User!</p>
                  )} 
              />
          <Route path="/users/:username/repos/:repoName" element={<RepoPage />}></Route>
        </Routes>
			</div>
		</Router>
	);
}

export default App;
